def output_netlist(out_path_folder, file_name, netlist_code):
    out_path_folder.mkdir(exist_ok=True, parents=True)
    with (out_path_folder / file_name).open(mode="w") as fout:
        fout.writelines(netlist_code)

def assemble_netlist(input, stored, output,capacitance):
    netlist = mac_template.get_inandstored(input,stored,capacitance)
    netlist+= mac_template.get_measure(output)
    return netlist



